import React from "react";
import Header from "../components/Header";

const Contact = () => {
  return (
    <div>
      <Header />
      <div className="content-contact">
        <div className="contact-me">
          <h1>Contactez moi</h1>
        </div>
        <div className="contact-reseaux"></div>
      </div>
    </div>
  );
};

export default Contact;
